// src/App.jsx
import React from "react";
import { Container, Box, Typography } from "eldora-ui";
import "./App.css";

function App() {
  return (
    <Container fluid style={{ height: "100vh", display: "flex" }}>
      {/* Left: Chat Window */}
      <Box
        style={{
          width: "33%",
          borderRight: "1px solid #e0e0e0",
          display: "flex",
          flexDirection: "column",
        }}
      >
        <Typography variant="h5" style={{ margin: "1rem" }}>
          Infraabot Chat
        </Typography>
        {/* Chat components will go here */}
      </Box>

      {/* Right: Layout Canvas */}
      <Box style={{ width: "67%", display: "flex", flexDirection: "column" }}>
        <Typography variant="h5" style={{ margin: "1rem" }}>
          Layout Preview
        </Typography>
        {/* Layout canvas will go here */}
      </Box>
    </Container>
  );
}

export default App;
